_edit_last','2'),(890,45,'_edit_lock','1558470551:2'),(895,45,'disclaimer','*This benefit is not insured by the FDIC or any other federal government agency.  Coverage is not guaranteed by the financial institution and may decrease in value.'),(896,45,'_disclaimer','field_54c858ed31c66'),(897,45,'title_description','&nbsp;\r\n\r\nDeath is a certainty...but no one knows when or how!\r\n\r\nWe can help you and your family in a great time of need.\r\n\r\n&nbsp;'),(898,45,'_title_description','field_54c8596b31c67'),(899,45,'benefit_image','466'),(900,45,'_benefit_image','field_54c859c931c68'),(901,45,'benefit_information_0_icon','163'),(902,45,'_benefit_information_0_icon','field_54c85a4531c6a'),(903,45,'benefit_information_0_icon_text','You don\'t have to be a window washer at the Empire State Building to need accidental death insurance. Every person alive is at risk. Are your loved ones financially prepared for the costs of an unexpected funeral?\r\n\r\n&nbsp;'),(904,45,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(905,45,'benefit_information_0_subtitle','Accidental Death and Dismemberment Insurance'),(906,45,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(907,45,'benefit_information_0_subtitle_description',''),(908,45,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(909,45,'benefit_information_0_callout_text','It is estimated that around 100,000 unintentional deaths occur in the U.S. every year'),(910,45,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(911,45,'benefit_information_0_optional_description','<em>\"My husband, Stephen Morris, had a decent job, a loving family and even a little in savings. When Stephen passed unexpectedly in a car accident, we were left to cover all of the costs.\" -- Kaitlynn Morris</em>\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\nAccidental death and dismemberment insurance, also known as AD&amp;D insurance, is supplementary coverage that offers extra protection for you and your family.\r\n\r\n[end_column]\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>Coverage is provided immediately as a program benefit at no additional charge</li>\r\n 	<li>Acceptance is guaranteed, no physical exam required</li>\r\n 	<li>Your coverage cannot be cancelled as long as you are a member and your sponsoring organization offers this program</li>\r\n</ul>\r\n[end_column]\r\n\r\n&nbsp;'),(912,45,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(913,45,'benefit_information_0_read_more_content','With this essential benefit, greatly ease your financial burden in the event of a death or dismemberment resulting from an accident, while saving the $10.00 to $15.00 annual premium typically payable for this type of coverage.'),(914,45,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(915,45,'benefit_information','1'),(916,45,'_benefit_information','field_54c859fd31c69'),(917,48,'company_logo','35'),(918,48,'_company_logo','field_54c5ab73ff6a4'),(919,48,'company_color','#dd3333'),(920,48,'_company_color','field_54c8667929258'),(921,48,'company_text_color',''),(922,48,'_company_text_color','field_54c866aa29259'),(923,48,'company_benefits','a:1:{i:0;s:2:\"45\";}'),(924,48,'_company_benefits','field_54c85ee6b9224'),(925,48,'slide_0_slide_text_color','white'),(926,48,'_slide_0_slide_text_color','field_73c437928d74b'),(927,48,'slide_0_slide_background_color','null'),(928,48,'_slide_0_slide_background_color','field_73c488928d74b'),(929,48,'slide_0_slide_background_image','30'),(930,48,'_slide_0_slide_background_image','field_73c438868d74c'),(931,48,'slide_0_slide_fixed_image',''),(932,48,'_slide_0_slide_fixed_image','field_742555ae716cc'),(933,48,'slide_0_slide_padding','null'),(934,48,'_slide_0_slide_padding','field_73c432228d74b'),(935,48,'slide_0_slide_builder_0_slide_column_size','medium-12'),(936,48,'_slide_0_slide_builder_0_slide_column_size','field_74207e5748902'),(937,48,'slide_0_slide_builder_0_slide_column_alignment'