4,'slide_0_slide_builder_0_slide_vertically_center_content','a:1:{i:0;s:14:\"vertical_align\";}'),(1070,54,'_slide_0_slide_builder_0_slide_vertically_center_content','field_742085ae716cc'),(1071,54,'slide_0_slide_builder','1'),(1072,54,'_slide_0_slide_builder','field_74207e5048901'),(1073,54,'slide','1'),(1074,54,'_slide','field_73c434fe8d746'),(1075,52,'benefit_information_0_icon','165'),(1076,52,'_benefit_information_0_icon','field_54c85a4531c6a'),(1077,52,'benefit_information_0_icon_text','Identity thieves steal mail, skim credit cards, hack into ATMs and rummage through garbage in the search for their next victim. In the blink of an eye, criminals misuse bits and pieces of your personal information to obtain fraudulent credit and make unauthorized purchases.\r\n\r\nNo matter what stage of life you are in, your identity will always be a prime target for thieves—you may not be aware of it, but the different stages of life put you at risk for different types of identity theft.\r\n\r\n&nbsp;'),(1078,52,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1079,52,'benefit_information_0_subtitle','CYBERSCOUT\'S LIFESTAGES® - formerly IDT911'),(1080,52,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1081,52,'benefit_information_0_subtitle_description','No additional enrollment required.'),(1082,52,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1083,52,'benefit_information_0_callout_text','Identity thieves are smart. We’re smarter.  Just as we rely on technology to make our lives easier, thieves and criminals rely on the same technology to steal personal information and commit fraudulent crimes. Protecting your identity is our priority!'),(1084,52,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1085,52,'benefit_information_0_optional_description','<em>\"What most people think is private is probably public. Last year, my personal information was stolen and used. I was totally unprepared, and it was a mess to resolve.\" -- Jeff Manziel</em>\r\n\r\n[column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\n<strong>Stay educated.</strong>\r\n\r\nIf you want more identity theft information or think you might be a victim of identity theft, you simply call us at a toll free number and you will be transferred to your personal-touch fraud specialist at CyberScout\'s Resolution Center.  There is no added cost to you for these services, no matter how often you talk to a fraud specialist.\r\n\r\n[end_column][column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\nOur LifeStages® services focus on these different stages of life:\r\n<ul>\r\n 	<li><strong>For those under 18</strong> – children often have just the right combination for identity thieves: a Social Security number and clean, or nonexistent credit</li>\r\n 	<li><strong>In your 20s</strong> – new jobs, new apartments, maybe even a new spouse. It’s easy to lose sight of your identity amid the flurry of fun.</li>\r\n 	<li><strong>In your 30s and 40s</strong> – kids, mortgages, car payments. There’s never been so much as stake.</li>\r\n 	<li><strong>In your 50s</strong> – Empty nesting, a taste of freedom…and college tuition. Just when things seem to be settling down, new responsibilities and risks kick in.</li>\r\n 	<li><strong>In your 60s and up</strong> – whether it’s time for early retirement or running after the grandkids, these can be special years.</li>\r\n</ul>\r\n[end_column]'),(1086,52,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1087,52,'benefit_information_0_read_more_content','During any stage of life our personal fraud specialists will guide you through the resolution process, no matter what your identity issue is, until your problem is fully resolved and your peace of mind is restored.'),(1088,52,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1147,77,'_wp_attached_file','2015/01/default-logo.png'),(1148,77,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:150;s:6:\"height\";i: