mation_0_subtitle_description','field_54c85a8a31c6d'),(1217,98,'benefit_information_0_callout_text',''),(1218,98,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1219,98,'benefit_information_0_optional_description',''),(1220,98,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1221,98,'benefit_information_0_read_more_content',''),(1222,98,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1223,98,'benefit_information','1'),(1224,98,'_benefit_information','field_54c859fd31c69'),(1251,100,'_edit_last','2'),(1252,100,'_edit_lock','1553631752:2'),(1253,100,'menu_item','Discounts'),(1254,100,'_menu_item','field_54c857ed31c66'),(1255,100,'disclaimer',''),(1256,100,'_disclaimer','field_54c858ed31c66'),(1257,100,'title_description','Discover savings doing what you enjoy at your favorite shops, restaurants and attractions all over the country.'),(1258,100,'_title_description','field_54c8596b31c67'),(1259,100,'benefit_image','87'),(1260,100,'_benefit_image','field_54c859c931c68'),(1261,100,'benefit_information','1'),(1262,100,'_benefit_information','field_54c859fd31c69'),(1263,100,'benefit_information_0_icon','166'),(1264,100,'_benefit_information_0_icon','field_54c85a4531c6a'),(1265,100,'benefit_information_0_icon_text','\"<em>I was shocked by the amount of money we saved on our last family vacation. We rented a car, stayed at a nice hotel and visited the amusement park, and it cost less than any of our other vacations.\"\r\n</em>-Sarah Albright'),(1266,100,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1267,100,'benefit_information_0_subtitle','Savings Made Easy'),(1268,100,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1269,100,'benefit_information_0_subtitle_description','Dine. Shop. Travel. Save!  '),(1270,100,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1271,100,'benefit_information_0_callout_text','Members can save up to hundreds of dollars on dining, shopping, traveling and more. Use our mobile app to save on-the-go.'),(1272,100,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1273,100,'benefit_information_0_optional_description','<p style=\"text-align: left;\"><strong>With your membership, you will receive:</strong></p>\r\n<p style=\"text-align: left;\"><strong>Retail &amp; Restaurant Savings</strong>\r\nGet access to a dynamic shopping program which will reward you every time you use it. Find great deals at hundreds of popular merchants and restaurants. Customers will find coupons and free shipping offers from top retailers and brands online. They will also receive discounts in stores and restaurants with mobile or print coupons.</p>\r\n<p style=\"text-align: left;\"><strong>Grocery Coupons</strong>\r\nSave on groceries, home and health-care products, pet products, supplies and more from trusted brands at top stores.</p>\r\n<p style=\"text-align: left;\"><strong>Big Savings on Attractions</strong>\r\nSave at major theme parks around the country. Plus, save off the box office price by purchasing movie tickets in advance for leading theaters.</p>\r\n<p style=\"text-align: left;\"><strong>Save 10% or more on Select Hotel Chains or More at Hundreds of Locations Nationwide</strong>\r\nWhether it’s a weekend getaway or family vacation, use these great discounts to save on your trip planning.</p>\r\n<p style=\"text-align: left;\"><strong>Other Travel Savings</strong>\r\nYou can save up to 20% on rental cars and even more on cruises and vacation packages, simply by calling the toll-free numbers.</p>'),(1274,100,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1275,100,'benefit_information_0_read_more_content','Whether it\'s a weekend staycation or your annual family vacation, you can\'t afford to let these savings pass you by.'),(1276,100,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1277,102,'_edit_last','2'),(1278,102,'_edit_lock','1522957390:2'),(1279,102,'menu_item','Health '),(1280,102,'_menu_item','field_54c857ed31c66'),(1281,102,'disclaimer',''),(1282,102,'_disclaimer','field_54c858ed31c66'),(1283,102,'title_description','The Affordable Care Act did not make all health care affordable.\r\nIt\'s time to start taking care of yourself and your wallet.'),(1284,102,'_title_description','field_54c8596b31c67'),(1285,102,'benefit_image','80'),(1286,102,'_benefit_image','field_54c859c931c68'),(1287,102,'benefit_information','1'),(1288,102,'_benefit_information','field_54c859fd31c69'),(1289,102,'benefit_information_0_icon','159'),(1290,102,'_benefit_information_0_icon','field_54c85a4531c6a'),(1291,102,'benefit_information_0_icon_text','<ul>\r\n 	<li>Prescription Drug Discounts - Accepted at over 59,000 pharmacies nationwide. Over 60,000 brand and generic drugs are included, with savings as high as 50%. Use any time and with no annual limit.</li>\r\n 	<li>Dental Discounts - Accepted at over 150,000 providers access points nationwide, and covers all dental services and specialties, including orthodontia. Savings can be as high as 45%, and there is no limitation on services or use.</li>\r\n 	<li>Vision Discounts - Accepted by over 11,000 OUTLOOK Vision providers. Cardholders receive up to 50% savings on lenses, frames, and other vision needs.</li>\r\n 	<li>Hearing Discounts - Receive a free hearing test and 15% discount on over 80 hearing aid models at 1,500 Beltone locations nationwide, with a Lifetime Care Program included.</li>\r\n</ul>\r\n<h6>*This is Not Insurance. It is a discount medical program. It does not replace COBRA or any other medical insurance program not is it a Medicare Part D prescription drug plan. Cardholders are responsible for paying the discounted cost at the time of service from participating providers. The DMPO does make available a list of all program providers which includes their name, city and state, and medical specialty prior to purchase, upon request. WellCard Rx is FREE. The discount plan organization is Access One Consumer Health, Inc., 84 Villa Road, Greenville, SC, 29615, www.accessonedmpo.com. This program is not available to residents of Montana, but may be used at participating Montana providers. Other state residents: visit www.WellCardRx.com for full disclosures.</h6>\r\n<a href=\"https://vimeo.com/user39246495/review/124830741/d53e35dd3d\" target=\"_blank\" rel=\"noopener\">Watch Video</a>'),(1292,102,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1293,102,'benefit_information_0_subtitle','WellCardRx Health Discounts'),(1294,102,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1295,102,'benefit_information_0_subtitle_description',''),(1296,102,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1297,102,'benefit_information_0_callout_text','Save money on Vision, Prescription, Dental and Hearing with this health discount program.'),(1298,102,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1299,102,'benefit_information_0_optional_description',''),(1300,102,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1301,102,'benefit_information_0_read_more_content','Stop throwing away the money that you could save with this program. It’s quick. It’s easy. And it’s just what the doctor ordered'),(1302,102,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1303,103,'_edit_last','2'),(1304,103,'_edit_lock','1524144186:2'),(1305,103,'menu_item','Lifelock'),(1306,103,'_menu_item','field_54c857ed31c66'),(1307,103,'disclaimer',''),(1308,103,'_disclaimer','field_54c858ed31c66'),(1309,103,'title_description','There are more than twice the stolen personal records exposed on black market websites than there are\r\npeople in the United States. Chances are good your information is already out there waiting to be sold.\r\nAre you and your family protected from identity thieves? Don\'t be another victim. Requires separate enrollment at an additional fee.'),(1310,103,'_title_description','field_54c8596b31c67'),(1311,103,'benefit_image','84'),(1312,103,'_benefit_image','field_54c859c931c68'),(1313,103,'benefit_information','1'),(1314,103,'_benefit_information','field_54c859fd31c69'),(1315,103,'benefit_information_0_icon','162'),(1316,103,'_benefit_information_0_icon','field_54c85a4531c6a'),(1317,103,'benefit_information_0_icon_text','<em>\"I signed up for LifeLock a few months ago, and </em><em>they\'ve already helped me avoid one theft </em><em>attempt. I was immediately alerted, and they </em><em>helped replace my credit card that very day. I feel </em><em>100% confident in this program.\"\r\n-Britney Burnett</em>'),(1318,103,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1319,103,'benefit_information_0_subtitle',''),(1320,103,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1321,103,'benefit_information_0_subtitle_description',''),(1322,103,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1323,103,'benefit_information_0_callout_text','It is figured that the majority of identity theft incidents (85%) involved the fraudulent use of existing account information, such as credit card or bank account information.'),(1324,103,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1325,103,'benefit_information_0_optional_description','<p style=\"text-align: left;\">In this age, we are more vulnerable than ever to identity theft. This means it is more important than ever to get the trusted protection for you and your family members. LifeLock gives you comprehensive protection from identity theft and fraudulent activity. With LifeLock, you receive:</p>\r\n<p style=\"text-align: left;\">·      Protection of your personal information from identity thieves\r\n·      Alerts for fraudulent activity like credit card and loan applications\r\n·      The monitoring of over 10,000 black market websites for illegal selling of your information\r\n·      Credit card replacement or cancellation due to loss\r\n·      40% off per month for LifeLock Standard™ or 15%  off per month for LifeLock Ultimate Plus™</p>\r\n<p style=\"text-align: left;\"></p>'),(1326,103,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1327,103,'benefit_information_0_read_more_content','<p style=\"text-align: center;\">If you select LifeLock Ultimate Plus™, they’ll also help you monitor your savings and checking accounts for takeover fraud* and provide online access to your annual credit reports and monthly score tracker. You can receive one LifeLock Standard™ membership per account at a 40% discount. The LifeLock UltimatePlus™ plan is available at a 15% discount off the membership price. You can also enroll additional household members and get a 10% discount off the membership list price of either service. <em>*Requires separate enrollment.</em></p>'),(1328,103,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1329,52,'benefit_information_1_icon','164'),(1330,52,'_benefit_information_1_icon','field_54c85a4531c6a'),(1331,52,'benefit_information_1_icon_text','\"<em>When my aunt passed away a few years ago, I saw the hardship it brought my uncle. Her records were scattered, and information was missing. I\'ve definitely learned to avoid the same situation.\"\r\n</em>-Ben Thomas\r\n\r\n<a href=\"https://vimeo.com/user39246495/review/124830745/c432ca02ff\" target=\"_blank\" rel=\"noopener\">Watch Video</a>'),(1332,52,'_benefit_information_1_icon_text','field_54c85a5a31c6b'),(1333,52,'benefit_information_1_subtitle','PERSONAL ESTATE GUIDE formerly LIVING FAMILY JOURNAL '),(1334,52,'_benefit_information_1_subtitle','field_54c85a7731c6c'),(1335,52,'benefit_information_1_subtitle_description','Would your loved ones know how to settle your affairs if you died or became incapacitated?'),(1336,52,'_benefit_information_1_subtitle_description','field_54c85a8a31c6d'),(1337,52,'benefit_information_1_callout_text','According to multiple studies, it is estimated that less than 1 in 5 Americans have all of their personal information adequately organized in one place.'),(1338,52,'_benefit_information_1_callout_text','field_54c85aab31c6e'),(1339,52,'benefit_information_1_optional_description','<p style=\"text-align: left;\">Gain peace of mind for you and your loved ones from the convenience of your personal computer. Organize, record and document personal, medical and financial information with your Living Family Journal software program. Keep track of and easily update:</p>\r\n\r\n<div style=\"text-align: left;\">\r\n\r\n[column size=\"1/2\"]\r\n\r\n·      Personal Information\r\n·      Medical Information\r\n·      Legal Information\r\n·      Financial Information\r\n\r\n[end_column]\r\n\r\n[column size=\"1/2\"]\r\n\r\n·      Real Estate Information\r\n·      Emergency Contacts\r\n·      Funeral Arrangements\r\n\r\n[end_column]\r\n\r\n&nbsp;\r\n\r\n</div>'),(1340,52,'_benefit_information_1_optional_description','field_54c85ad231c6f'),(1341,52,'benefit_information_1_read_more_content','Reduce the frustrations associated with disorganization by utilizing this mobile friendly website.'),(1342,52,'_benefit_information_1_read_more_content','field_54c85b2931c70'),(1345,105,'_edit_last','2'),(1346,105,'_edit_lock','1530287221:2'),(1347,105,'menu_item','IDIQ Max'),(1348,105,'_menu_item','field_54c857ed31c66'),(1349,105,'disclaimer',''),(1350,105,'_disclaimer','field_54c858ed31c66'),(1351,105,'title_description','There are more than twice the stolen personal records exposed on black market websites than there are\r\npeople in the United States. Chances are good your information is already out there waiting to be sold.\r\nAre you and your family protected from identity thieves? Don\'t be another victim.'),(1352,105,'_title_description','field_54c8596b31c67'),(1353,105,'benefit_image','81'),(1354,105,'_benefit_image','field_54c859c931c68'),(1355,105,'benefit_information','1'),(1356,105,'_benefit_information','field_54c859fd31c69'),(1357,105,'benefit_information_0_icon','157'),(1358,105,'_benefit_information_0_icon','field_54c85a4531c6a'),(1359,105,'benefit_information_0_icon_text','<em>\"IdentityIQ helped me avoid one theft attempt. </em><em>I was sent an email when someone checked my </em><em>credit for a loan in my name and I knew it </em><em>wasn\'t me.\"</em>\r\n-Britney Burnett\r\n\r\n&nbsp;'),(1360,105,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1361,105,'benefit_information_0_subtitle','Identity IQ Protect Max'),(1362,105,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1363,105,'benefit_information_0_subtitle_description','*Requires Separate Enrollment'),(1364,105,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1365,105,'benefit_information_0_callout_text','It is figured that the majority of identity theft incidents (85%) involved the fraudulent use of existing account information, such as credit card or bank account information.'),(1366,105,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1367,105,'benefit_information_0_optional_description','By enrolling in this package of benefits through your financial institution, you become eligible for a complimentary Identity IQ Protect Max membership.  This is an OPTIONAL service and requires separate enrollment on your behalf.  Your membership in this package does not automatically include an Identity IQ Protect Max membership.\r\n\r\nIdentityIQ provides you with the financial peace of mind, making you and informed and proactive consumer with a team of experts to support you. Know what is in your credit reports at the major credit reporting agencies. Watch for changes in your credit score and receive alerts if something changes in your credit file. Plan your best defense with our identity theft restoration products, like insurance, and services.\r\n\r\n[column size=\"1/2\"]\r\n<em>With IdentityIQ Protect Max, you receive:</em>\r\n<ul>\r\n 	<li><em>3 Bureau Daily Credit Monitoring &amp; Alerts</em></li>\r\n 	<li><em>3 Bureau Credit Report &amp; Score (Quarterly)</em></li>\r\n 	<li><em>Discounted Additional Reports &amp; Scores </em></li>\r\n 	<li><em>$1,000,000 ID Theft Insurance </em></li>\r\n 	<li><em>Credit Score Tracker </em></li>\r\n 	<li><em>ID Fraud Restoration Specialist </em></li>\r\n</ul>\r\n[end_column]\r\n\r\n[column size=\"1/2\" class=\"pt50\"]\r\n<ul>\r\n 	<li><em>Fraud Alert Assistance </em></li>\r\n 	<li><em>Opt-out IQ (Junk Mail/Do Not Call List)</em></li>\r\n 	<li><em>Checking Account Report </em></li>\r\n 	<li><em>Lost Wallet Form &amp; Assistance </em></li>\r\n 	<li><em>Credit Score Simulator </em></li>\r\n 	<li><em>IQ Center </em></li>\r\n</ul>\r\n[end_column]'),(1368,105,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1369,105,'benefit_information_0_read_more_content','<p style=\"text-align: center;\">You can also enroll additional household\r\nmembers and get a 25% discount off the membership list price.\r\n<em>*Requires separate enrollment.</em></p>'),(1370,105,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1371,106,'_edit_last','2'),(1372,106,'_edit_lock','1524144143:2'),(1373,106,'menu_item','IDIQ'),(1374,106,'_menu_item','field_54c857ed31c66'),(1375,106,'disclaimer','Requires separate enrollment*'),(1376,106,'_disclaimer','field_54c858ed31c66'),(1377,106,'title_description','There are more than twice the stolen personal records exposed on black market websites than there are\r\npeople in the United States. Chances are good your information is already out there waiting to be sold.\r\nAre you and your family protected from identity thieves? Don\'t be another victim.'),(1378,106,'_title_description','field_54c8596b31c67'),(1379,106,'benefit_image','83'),(1380,106,'_benefit_image','field_54c859c931c68'),(1381,106,'benefit_information','1'),(1382,106,'_benefit_information','field_54c859fd31c69'),(1383,106,'benefit_information_0_icon','161'),(1384,106,'_benefit_information_0_icon','field_54c85a4531c6a'),(1385,106,'benefit_information_0_ico