'field_74208529716cb'),(1549,130,'slide_0_slide_builder_0_slide_column_link','null'),(1550,130,'_slide_0_slide_builder_0_slide_column_link','field_742086b2716cd'),(1551,130,'slide_0_slide_builder_0_slide_vertically_center_content','a:1:{i:0;s:14:\"vertical_align\";}'),(1552,130,'_slide_0_slide_builder_0_slide_vertically_center_content','field_742085ae716cc'),(1553,130,'slide_0_slide_builder','1'),(1554,130,'_slide_0_slide_builder','field_74207e5048901'),(1555,130,'slide','1'),(1556,130,'_slide','field_73c434fe8d746'),(1558,135,'menu_item','Security'),(1559,135,'_menu_item','field_54c857ed31c66'),(1560,135,'disclaimer',''),(1561,135,'_disclaimer','field_54c858ed31c66'),(1562,135,'title_description','In life, peace of mind and protection are key. With these two features you can save over $100 a year in benefits that will give you and your family the security you need.'),(1563,135,'_title_description','field_54c8596b31c67'),(1564,135,'benefit_image','86'),(1565,135,'_benefit_image','field_54c859c931c68'),(1566,135,'benefit_information_0_icon','96'),(1567,135,'_benefit_information_0_icon','field_54c85a4531c6a'),(1568,135,'benefit_information_0_icon_text','Identity thieves steal mail, skim credit cards, hack into ATMs and rummage through garbage in the search for their next victim. In the blink of an eye, criminals misuse bits and pieces of your personal information to obtain fraudulent credit and make unauthorized purchases.\r\n\r\nNo matter what stage you are in life, your identity will always be a prime target for thieves—you may not be aware of it, but the different stages of life put you at risk for different types of identity theft'),(1569,135,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(1570,135,'benefit_information_0_subtitle','IDT911\'S LIFESTAGES®'),(1571,135,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(1572,135,'benefit_information_0_subtitle_description','No additional enrollment required.'),(1573,135,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(1574,135,'benefit_information_0_callout_text','Identity thieves are smart. We’re smarter.  Just as we rely on technology to make our lives easier, thieves and criminals rely on the same technology to steal personal information and commit fraudulent crimes. Protecting your identity is our priority!'),(1575,135,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(1576,135,'benefit_information_0_optional_description','<em>\"What most people think is private is probably public. Last year, my personal information was stolen and used. I was totally unprepared, and it was a mess to resolve.\" -- Jeff Manziel</em>\r\n\r\n[column size=\"1/2\"  class=\"pt50\"]\r\n\r\n<strong>Don’t wait until you’re a victim.</strong>\r\n\r\nIf you want more identity theft information or think you might be a victim of identity theft, you simply call us at a toll free number and you will be transferred to your personal-touch fraud specialist at IDT911\'s Resolution Center.  There is no added cost to you for these services, no matter how often you talk to a fraud specialist.\r\n\r\n[end_column][column size=\"1/2\"  class=\"pt50\"]\r\n\r\nOur LifeStages® services focus on these different stages of life:\r\n<ul>\r\n	<li><strong>For those under 18</strong> – children often have just the right combination for identity thieves: a Social Security number and clean, or nonexistent credit</li>\r\n	<li><strong>In your 20s</strong> – new jobs, new apartments, maybe even a new spouse. It’s easy to lose sight of your identity amid the flurry of fun.</li>\r\n	<li><strong>In your 30s and 40s</strong> – kids, mortgages, car payments. There’s never been so much as stake.</li>\r\n	<li><strong>In your 50s</strong> – Empty nesting, a taste of freedom…and college tuition. Just when things seem to be settling down, new responsibilities and risks kick in.</li>\r\n	<li><strong>In your 60s and up</strong> – whether it’s time for early retirement or running after the grandkids, these can be special years.</li>\r\n</ul>\r\n[end_column]'),(1577,135,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1578,135,'benefit_information_0_read_more_content','During any stage of life our personal fraud specialists will guide you through the proactive and resolution process, no matter what your identity issue is, until your problem is fully resolved and your peace of mind is restored.'),(1579,135,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1580,135,'benefit_information_1_icon','89'),(1581,135,'_benefit_information_1_icon','field_54c85a4531c6a'),(1582,135,'benefit_information_1_icon_text','\"<em>When my aunt passed away a few years ago, I saw the hardship it brought my uncle. Her records were scattered, and information was missing. I\'ve definitely learned to avoid the same situation.\"\r\n</em>-Ben Thomas'),(1583,135,'_benefit_information_1_icon_text','field_54c85a5a31c6b'),(1584,135,'benefit_information_1_subtitle','LIVING FAMILY JOURNAL '),(1585,135,'_benefit_information_1_subtitle','field_54c85a7731c6c'),(1586,135,'benefit_information_1_subtitle_description','Would your loved ones know how to settle your affairs if you died or became incapacitated?'),(1587,135,'_benefit_information_1_subtitle_description','field_54c85a8a31c6d'),(1588,135,'benefit_information_1_callout_text','According to multiple studies, it is estimated that less than 1 in 5 Americans have all of their personal information adequately organized in one place.'),(1589,135,'_benefit_information_1_callout_text','field_54c85aab31c6e'),(1590,135,'benefit_information_1_optional_description','<p style=\"text-align: left;\">Gain peace of mind for you and your loved ones from the convenience of your personal computer. Organize, record and document personal, medical and financial information with your Living Family Journal software program. Keep track of and easily update:</p>\r\n\r\n<div style=\"text-align: left;\">\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\n·      Personal Information\r\n·      Medical Information\r\n·      Legal Information\r\n·      Financial Information\r\n\r\n[end_column] [column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\n·      Real Estate Information\r\n·      Insured Valuables\r\n·      Funeral Arrangements\r\n\r\n[end_column]\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<p style=\"text-align: left;\">Reduce the frustrations associated with disorganization with this comprehensive solution.</p>'),(1591,135,'_benefit_information_1_optional_description','field_54c85ad231c6f'),(1592,135,'benefit_information_1_read_more_content','Reduce the frustrations associated with disorganization by downloading this\r\ncomprehensive solution'),(1593,135,'_benefit_information_1_read_more_content','field_54c85b2931c70'),(1594,135,'benefit_information','2'),(1595,135,'_benefit_information','field_54c859fd31c69'),(1596,136,'_edit_lock','1524147790:2'),(1597,136,'_edit_last','2'),(1598,137,'_wp_attached_file','2015/04/NavyArmy.jpg'),(1599,137,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:290;s:6:\"height\";i:100;s:4:\"file\";s:20:\"2015/04/NavyArmy.jpg\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:20:\"NavyArmy-150x100.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:11:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";s:11:\"orientation\";i:0;}}'),(1600,136,'_wp_page_template','default'),(1601,136,'company_logo','137'),(1602,136,'_company_logo','field_54c5ab73ff6a4'),(1603,136,'company_color','#0b408c'),(1604,136,'_company_color','field_54c8667929258'),(1605,136,'company_text_color','#0b408c'),(1606,136,'_company_text_color','field_54c866aa29259'),(1607,136,'company_benefits','a:4:{i:0;s:2:\"45\";i:1;s:3:\"100\";i:2;s:2:\"52\";i:3;s:3:\"102\";}'),(1608,