undred dollars per twelve month period.  Other details are provided in the description of coverage.  The cellular telephone bill must be paid out of the eligible account.'),(1755,148,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(1756,148,'benefit_information_0_read_more_content','Do not leave yourself in a crack, get protection for your cellular phone included with your checking account.'),(1757,148,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(1758,148,'benefit_information','1'),(1759,148,'_benefit_information','field_54c859fd31c69'),(1812,154,'_wp_attached_file','2015/04/Happy-State-Bank-Logo.jpg'),(1813,154,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:180;s:6:\"height\";i:153;s:4:\"file\";s:33:\"2015/04/Happy-State-Bank-Logo.jpg\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:33:\"Happy-State-Bank-Logo-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:11:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";s:11:\"orientation\";i:0;}}'),(1817,157,'_wp_attached_file','2015/01/SISK-IdentityIQMax-Icon.jpg'),(1818,157,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:235;s:6:\"height\";i:157;s:4:\"file\";s:35:\"2015/01/SISK-IdentityIQMax-Icon.jpg\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:35:\"SISK-IdentityIQMax-Icon-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:11:{s:8:\"aperture\";i:0;s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";i:0;s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";i:0;s:3:\"iso\";i:0;s:13:\"shutter_speed\";i:0;s:5:\"title\";s:0:\"\";s:11:\"orientation\";i:0;}}'),(1819,158,'_wp_attached_file','2015/01