; Premier Checking</h2>\r\n&nbsp;'),(6888,408,'_slide_0_slide_builder_0_slide_column_content','field_74208212716c9'),(6889,408,'slide_0_slide_builder_0_slide_content_background','null'),(6890,408,'_slide_0_slide_builder_0_slide_content_background','field_74208529716cb'),(6891,408,'slide_0_slide_builder_0_slide_column_link','null'),(6892,408,'_slide_0_slide_builder_0_slide_column_link','field_742086b2716cd'),(6893,408,'slide_0_slide_builder_0_slide_vertically_center_content','a:1:{i:0;s:14:\"vertical_align\";}'),(6894,408,'_slide_0_slide_builder_0_slide_vertically_center_content','field_742085ae716cc'),(6895,408,'slide_0_slide_builder','1'),(6896,408,'_slide_0_slide_builder','field_74207e5048901'),(6897,408,'slide','1'),(6898,408,'_slide','field_73c434fe8d746'),(6899,410,'_edit_lock','1524144106:2'),(6900,410,'_edit_last','2'),(6901,410,'menu_item','Identity Theft Resolution'),(6902,410,'_menu_item','field_54c857ed31c66'),(6903,410,'disclaimer',''),(6904,410,'_disclaimer','field_54c858ed31c66'),(6905,410,'title_description','In life, peace of mind is key. With this feature you can save over $80 a year in benefits that will give you and your family the valuable information about identity theft that you need.'),(6906,410,'_title_description','field_54c8596b31c67'),(6907,410,'benefit_image','86'),(6908,410,'_benefit_image','field_54c859c931c68'),(6909,410,'benefit_information','1'),(6910,410,'_benefit_information','field_54c859fd31c69'),(6911,410,'benefit_information_0_icon','165'),(6912,410,'_benefit_information_0_icon','field_54c85a4531c6a'),(6913,410,'benefit_information_0_icon_text','Identity thieves steal mail, skim credit cards, hack into ATMs and rummage through garbage in the search for their next victim. In the blink of an eye, criminals misuse bits and pieces of your personal information to obtain fraudulent credit and make unauthorized purchases.\r\n\r\nNo matter what stage of life you are in, your identity will always be a prime target for thieves—you may not be aware of it, but the different stages of life put you at risk for different types of identity theft.\r\n\r\n&nbsp;'),(6914,410,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(6915,410,'benefit_information_0_subtitle','CyberScout LIFESTAGES®'),(6916,410,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(6917,410,'benefit_information_0_subtitle_description','No additional enrollment required.'),(6918,410,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(6919,410,'benefit_information_0_callout_text','Identity thieves are smart. We’re smarter.  Just as we rely on technology to make our lives easier, thieves and criminals rely on the same technology to steal personal information and commit fraudulent crimes. Protecting your identity is our priority!'),(6920,410,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(6921,410,'benefit_information_0_optional_description','<em>\"What most people think is private is probably public. Last year, my personal information was stolen and used. I was totally unprepared, and it was a mess to resolve.\" -- Jeff Manziel</em>\r\n\r\n[column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\n<strong>Stay educated.</strong>\r\n\r\nIf you want more identity theft information or think you might be a victim of identity theft, you simply call us at a toll free number and you will be transferred to your personal-touch fraud specialist at CyberScout\'s Resolution Center.  There is no added cost to you for these services, no matter how often you talk to a fraud specialist.\r\n\r\n[end_column][column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\nOur LifeStages® services focus on education for these different stages of life:\r\n<ul>\r\n 	<li><strong>For those under 18</strong> – children often have just the right combination for identity thieves: a Social Security number and clean, or nonexistent credit</li>\r\n 	<li><strong>In your 20s</strong> – new jobs, new apartments, maybe even a new spouse. It’s easy to lose sight of your identity amid the flurry of fun.</li>\r\n 	<li><strong>In your 30s and 40s</strong> – kids, mortgages, car payments. There’s never been so much as stake.</li>\r\n 	<li><strong>In your 50s</strong> – Empty nesting, a taste of freedom…and college tuition. Just when things seem to be settling down, new responsibilities and risks kick in.</li>\r\n 	<li><strong>In your 60s and up</strong> – whether it’s time for early retirement or running after the grandkids, these can be special years.</li>\r\n</ul>\r\n[end_column]'),(6922,410,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(6923,410,'benefit_information_0_read_more_content','During any stage of life our personal fraud specialists will guide you through the resolution process, no matter what your identity issue is, until your problem is fully resolved and your peace of mind is restored.'),(6924,410,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(7189,418,'company_logo','175'),(7190,418,'_company_logo','field_54c5ab73ff6a4'),(7191,418,'company_color','#4c0808'),(7192,418,'_company_color','field_54c8667929258'),(7193,418,'company_text_color','#4c0808'),(7194,418,'_company_text_color','field_54c866aa29259'),(7195,418,'company_benefits','a:6:{i:0;s:3:\"148\";i:1;s:3:\"102\";i:2;s:3:\"105\";i:3;s:2:\"45\";i:4;s:3:\"100\";i:5;s:2:\"52\";}'),(7196,418,'_company_benefits','field_54c85ee6b9224'),(7197,418,'website_link','https://www.bradynationalbank.com/'),(7198,418,'_website_link','field_54207f7b48904'),(7199,418,'slide_0_slide_text_color','white'),(7200,418,'_slide_0_slide_text_color','field_73c437928d74b'),(7201,418,'slide_0_slide_background_color','null'),(7202,418,'_slide_0_slide_background_color','field_73c488928d74b'),(7203,418,'slide_0_slide_background_image','79'),(7204,418,'_slide_0_slide_background_image','field_73c438868d74c'),(7205,418,'slide_0_slide_fixed_image',''),(7206,418,'_slide_0_slide_fixed_image','field_742555ae716cc'),(7207,418,