,(8586,507,'_slide_0_slide_builder_0_slide_content_background','field_74208529716cb'),(8587,507,'slide_0_slide_builder_0_slide_column_link','null'),(8588,507,'_slide_0_slide_builder_0_slide_column_link','field_742086b2716cd'),(8589,507,'slide_0_slide_builder_0_slide_vertically_center_content','a:1:{i:0;s:14:\"vertical_align\";}'),(8590,507,'_slide_0_slide_builder_0_slide_vertically_center_content','field_742085ae716cc'),(8591,507,'slide_0_slide_builder','1'),(8592,507,'_slide_0_slide_builder','field_74207e5048901'),(8593,507,'slide','1'),(8594,507,'_slide','field_73c434fe8d746'),(8595,509,'menu_item','CyberScout formerly IDT911'),(8596,509,'_menu_item','field_54c857ed31c66'),(8597,509,'disclaimer',''),(8598,509,'_disclaimer','field_54c858ed31c66'),(8599,509,'title_description','In life, peace of mind is key. With this feature you can save over $80 a year in benefits that will give you and your family the valuable information about identity theft that you need.'),(8600,509,'_title_description','field_54c8596b31c67'),(8601,509,'benefit_image','86'),(8602,509,'_benefit_image','field_54c859c931c68'),(8603,509,'benefit_information_0_icon','165'),(8604,509,'_benefit_information_0_icon','field_54c85a4531c6a'),(8605,509,'benefit_information_0_icon_text','Identity thieves steal mail, skim credit cards, hack into ATMs and rummage through garbage in the search for their next victim. In the blink of an eye, criminals misuse bits and pieces of your personal information to obtain fraudulent credit and make unauthorized purchases.\r\n\r\nNo matter what stage of life you are in, your identity will always be a prime target for thieves—you may not be aware of it, but the different stages of life put you at risk for different types of identity theft.\r\n\r\n<a href=\"https://vimeo.com/user39246495/review/125806699/c552277c22\" target=\"_blank\">Watch Video</a>'),(8606,509,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(8607,509,'benefit_information_0_subtitle','LIFESTAGES®'),(8608,509,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(8609,509,'benefit_information_0_subtitle_description','No additional enrollment required.'),(8610,509,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(8611,509,'benefit_information_0_callout_text','Identity thieves are smart. We’re smarter.  Just as we rely on technology to make our lives easier, thieves and criminals rely on the same technology to steal personal information and commit fraudulent crimes. Protecting your identity is our priority!'),(8612,509,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(8613,509,'benefit_information_0_optional_description','<em>\"What most people think is private is probably public. Last year, my personal information was stolen and used. I was totally unprepared, and it was a mess to resolve.\" -- Jeff Manziel</em>\r\n\r\n[column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\n<strong>Stay educated.</strong>\r\n\r\nIf you want more identity theft information or think you might be a victim of identity theft, you simply call us at a toll free number and you will be transferred to your personal-touch fraud specialist at CyberScout\'s Resolution Center.  There is no added cost to you for these services, no matter how often you talk to a fraud specialist.\r\n\r\n[end_column][column size=\"1/2\"  class=\"pt50\"]\r\n\r\n&nbsp;\r\n\r\nOur LifeStages® services focus on education for these different stages of life:\r\n<ul>\r\n 	<li><strong>For those under 18</strong> – children often have just the right combination for identity thieves: a Social Security number and clean, or nonexistent credit</li>\r\n 	<li><strong>In your 20s</strong> – new jobs, new apartments, maybe even a new spouse. It’s easy to lose sight of your identity amid the flurry of fun.</li>\r\n 	<li><strong>In your 30s and 40s</strong> – kids, mortgages, car payments. There’s never been so much as stake.</li>\r\n 	<li><strong>In your 50s</strong> – Empty nesting, a taste of freedom…and college tuition. Just when things seem to be settling down, new responsibilities and risks kick in.</li>\r\n 	<li><strong>In your 60s and up</strong> – whether it’s time for early retirement or running after the grandkids, these can be special years.</li>\r\n</ul>\r\n[end_column]'),(8614,509,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(8615,509,'benefit_information_0_read_more_content','During any stage of life our personal fraud specialists will guide you through the resolution process, no matter what your identity issue is, until your problem is fully resolved and your peace of mind is restored.'),(8616,509,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(8617,509,'benefit_information','1'),(8618,509,'_benefit_information','field_54c859fd31c69'),(8619,511,'_edit_lock','1524147681:2'),(8620,511,'_edit_last','2'),(8621,512,'_wp_attached_file','2017/05/img_logo_bank.gif'),(8622,512,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:290;s:6:\"height\";i:104;s:4:\"file\";s:25:\"2017/05/img_logo_bank.gif\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:25:\"img_logo_bank-150x104.gif\";s:5:\"width\";i:150;s:6:\"height\";i:104;s:9:\"mime-type\";s:9:\"image/gif\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(8623,511,'_wp_page_template','default'),(8624,511,'company_logo','512'),(8625,511,'_company_logo','field_54c5ab73ff6a4'),(8626,511,'company_color','#004f30'),(8627,511,'_company_color','field_54c8667929258'),(8628,511,'company_text_color','#cca048'),(8629,511,'_company_text_color','field_54c866aa29259'),(8630,511,'company_benefits','a:5:{i:0;s:2:\"45\";i:1;s:3:\"103\";i:2;s:3:\"100\";i:3;s:2:\