4,514,'_slide_0_slide_builder_0_slide_vertically_center_content','field_742085ae716cc'),(8715,514,'slide_0_slide_builder','1'),(8716,514,'_slide_0_slide_builder','field_74207e5048901'),(8717,517,'menu_item','Insurance'),(8718,517,'_menu_item','field_54c857ed31c66'),(8719,517,'disclaimer','*This benefit is not FDIC insured or any federal government agency.  Not guaranteed by the institution and may decrease in value.'),(8720,517,'_disclaimer','field_54c858ed31c66'),(8721,517,'title_description','Death is a certainty...but no one knows when or how!\r\n\r\nWe can help you and your family in a great time of need.\r\n\r\n&nbsp;'),(8722,517,'_title_description','field_54c8596b31c67'),(8723,517,'benefit_image','466'),(8724,517,'_benefit_image','field_54c859c931c68'),(8725,517,'benefit_information_0_icon','163'),(8726,517,'_benefit_information_0_icon','field_54c85a4531c6a'),(8727,517,'benefit_information_0_icon_text','You don\'t have to be a window washer at the Empire State Building to need accidental death insurance. Every person alive is at risk. Are your loved ones financially prepared for the costs of an unexpected funeral?\r\n\r\n<a href=\"https://vimeo.com/user39246495/review/124830740/a3ae641e91\" target=\"_blank\" rel=\"noopener\">Watch Video</a>'),(8728,517,'_benefit_information_0_icon_text','field_54c85a5a31c6b'),(8729,517,'benefit_information_0_subtitle','Accidental Death and Dismemberment Insurance'),(8730,517,'_benefit_information_0_subtitle','field_54c85a7731c6c'),(8731,517,'benefit_information_0_subtitle_description',''),(8732,517,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d'),(8733,517,'benefit_information_0_callout_text','It is estimated that around 100,000 unintentional deaths occur in the U.S. every year'),(8734,517,'_benefit_information_0_callout_text','field_54c85aab31c6e'),(8735,517,'benefit_information_0_optional_description','<em>\"My husband, Stephen Morris, had a decent job, a loving family and even a little in savings. When Stephen passed unexpectedly in a car accident, we were left to cover all of the costs.\" -- Kaitlynn Morris</em>\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\nAccidental death and dismemberment insurance, also known as AD&amp;D insurance, is supplementary coverage that offers extra protection for you and your family.\r\n\r\n[end_column]\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>Coverage is provided immediately as a program benefit at no additional charge</li>\r\n 	<li>Acceptance is guaranteed, no physical exam required</li>\r\n 	<li>Your coverage cannot be cancelled as long as you are a member and your sponsoring organization offers this program</li>\r\n</ul>\r\n[end_column]\r\n\r\n&nbsp;'),(8736,517,'_benefit_information_0_optional_description','field_54c85ad231c6f'),(8737,517,'benefit_information_0_read_more_content','With this essential benefit, greatly ease your financial burden in the event of a death or dismemberment resulting from an accident, while saving the $10.00 to $15.00 annual premium typically payable for this type of coverage.'),(8738,517,'_benefit_information_0_read_more_content','field_54c85b2931c70'),(8739,517,'benefit_information','1'),(8740,517,'_benefit_information','field_54c859fd31c69'),(8741,518,'_wp_attached_file','2015/05/rio-bank-fdic-logo.jpg'),(8742,518,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:450;s:6:\"height\";i:300;s:4:\"file\";s:30:\"2015/05/rio-bank-fdic-logo.jpg\";s:5:\"sizes\";a:2:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:30:\"rio-bank-fdic-logo-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:30:\"rio-bank-fdic-logo-300x200.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:200;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0